import React from "react";
import "./App.css";
import Landing from "../pages/Landing";
require("dotenv").config();

callHubbleAPI = async () => {
  const response = await fetch("/image");
  const img = await response;

  this.setState({
    img: img
  });
};
function App() {
  return (
    <div className="wrapper">
      <Landing />
      <div>
        hello in this div there's an image
        <img
          src="s3://mushroom-images-bucket/Agaricus_subrufescens_1.jpg"
          alt=""
        />
      </div>
    </div>
  );
}

export default App;
